import React, { Fragment } from "react";

import "./NavigationBar.css";

const NavigationBar = () => {
  return (
    <Fragment>
      <ul className="nav-container">
        <li>
          <img className="nav-logo" src="" alt="logo" />
        </li>
        <li>
          <a href="#feautures">Features</a>
        </li>
        <li>
          <a href="#team">Team</a>
        </li>
        <li>
          <a href="#download">Download</a>
        </li>
      </ul>
    </Fragment>
  );
};

export default NavigationBar;
